import React from 'react';
import styled from 'styled-components';
import { theme } from '../../../theme';

const Nav = styled.nav`
    background-color: ${(props) => props.theme.light.darker};
`

function NavBar() {
  return (
      <Nav></Nav>
  )
}

export default NavBar;
